е), беременности нет, сдана кровь на хгч(отриц.) сейчас с момента последней менструации прошло 36 дней(идёт задержка) половых отношений не было. Может ли быть беременность, с незащещеного акта с января? ";s:5:"files";s:0:"";s:4:"date";s:22:"24 февраля 2020";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:8:"МЦРМ";s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:8:"position";s:0:"";s:4:"text";s:184:"Если все отрицательно, то очевидно, не может быть. Начните принимать поливитамины типа супрадин 1 мес";s:5:"files";s:0:"";s:4:"date";s:22:"24 февраля 2020";s:13:"specialist_id";s:0:"";}}i:16637;a:5:{s:15:"DETAIL_PAGE_URL";s:24:"/patients/consult/16637/";s:16:"isAnswererClinic";b:0;s:8:"answerer";a:4:{s:5:"image";a:18:{s:8:"ORIGINAL";s:55:"/upload/main/bc2/Sukhomlina_PhotoRoom.png_PhotoRoom.png";s:13:"webp_ORIGINAL";s:78:"/upload/resize_cache/main/bc2/0_0_1_95/Sukhomlina_PhotoRoom.png_PhotoRoom.webp";s:9:"100_100_P";s:78:"/upload/resize_cache/main/bc2/100_100_1/Sukhomlina_PhotoRoom.png_PhotoRoom.png";s:14:"webp_100_100_P";s:82:"/upload/resize_cache/main/bc2/100_100_1_95/Sukhomlina_PhotoRoom.png_PhotoRoom.webp";s:19:"quotas_registration";s:78:"/upload/resize_cache/main/bc2/190_200_1/Sukhomlina_PhotoRoom.png_PhotoRoom.png";s:24:"webp_quotas_registration";s:82:"/upload/resize_cache/main/bc2/190_200_1_95/Sukhomlina_PhotoRoom.png_PhotoRoom.webp";s:15:"specialist_list";s:78:"/upload/resize_cache/main/bc2/352_304_1/Sukhomlina_PhotoRoom.png_PhotoRoom.png";s:20:"webp_specialist_list";s:82:"/upload/resize_cache/main/bc2/352_304_1_95/Sukhomlina_PhotoRoom.png_PhotoRoom.webp";s:19:"specialist_list_big";s:78:"/upload/resize_cache/main/bc2/568_548_1/Sukhomlina_PhotoRoom.png_PhotoRoom.png";s:24:"webp_specialist_list_big";s:82:"/upload/resize_cache/main/bc2/568_548_1_95/Sukhomlina_PhotoRoom.png_PhotoRoom.webp";s:24:"specialist_detail_header";s:78:"/upload/resize_cache/main/bc2/448_471_1/Sukhomlina_PhotoRoom.